import { Button, Card, CardActions, CardContent, Typography } from "@material-ui/core";
import React from "react";
const MyCard=()=>{
    const getCard=()=>{
        return (
            <Card> 
                <CardContent>
                    <Typography>This is a card</Typography>
                </CardContent>
                <CardActions>
                    <Button variant="contained" color="secondary">
                        Show detail 
                    </Button>
                </CardActions>
            </Card>

        );
    };
    return getCard();
    
};
export default MyCard;
